class MyMap extends AbstractMap implements Cloneable {
  private Map map=new HashMap();
  public Set entrySet(){
    return map.entrySet();
  }
  public Object put(  Object key,  Object value){
    return map.put(key,value);
  }
  public Map getMap(){
    return map;
  }
  public Object clone(){
    try {
      return super.clone();
    }
 catch (    CloneNotSupportedException e) {
      return null;
    }
  }
}
